import React, { useState, useEffect } from "react";
import Nav from "./Nav"
import '../App.css';

export default function Manager_Orderding_List(props) {
    const [orders, setOrders] = useState([{}]);
    useEffect(() => {
        async function getAllOrders() {
            let prod = await fetch("http://localhost:3000/orders/ordered", {
                method: 'GET'
            });
            let pro = await prod.json();
            setOrders(pro);


        }
        getAllOrders();
    }, []);
    return (<div>
        <Nav />
        <br /><br /><br />
        {orders.map((order) =>
            (<div>
                <p>order code:</p>
                {order.OrderCode}
                <p>order price:</p>
                {order.OrderPrice}
                <p>date:</p>
                <p>client details:</p>
                <p>name:</p>
                <p>adress:</p>
                <p>payment details</p>
                <p>total payment:</p>
                <p>credit card number:</p>
            </div>)
        )}
        {/* map  על הזמנות */}

        <p>date:</p>
        <p>client details:</p>
        <p>name:</p>
        <p>adress:</p>
        <p>payment details</p>
        <p>total payment:</p>
        <p>credit card number:</p>
    </div>);
}
